import React from 'react';
import { Adsense } from '@ctrl/react-adsense';
// import './InnerPage.css';

function Blog() {

    return (
        <React.Fragment>
            {/* Head Section */}
            <section>
            </section>
            {/* googleAdsense */}
            <div className='googleAdsense'>
                <Adsense
                    client={process.env.REACT_APP_GOOGLE_ADSENSE}
                    slot={process.env.REACT_APP_GOOGLE_ADSENSE_SLOT}
                    style={{ display: 'block' }}
                    layout="in-article"
                    format="fluid"
                />
            </div>



            {/* Button Section  */}

            <section>
            </section>

            {/* Container Section */}

            <section>
            </section>

            {/* Footer */}

            <footer>
            </footer>
        </React.Fragment>
    );
};

export default Blog;
